import React from "react";
import "./button.scss";

const Button = ({ text = "Done", onClick, align }) => {
  const className = `gradient-btn${align === "left" ? " left" : ""}`;
  return (
    <button className={className} onClick={onClick}>
      {text}
    </button>
  );
};

export default Button;
